import React from 'react';
import './Header.css';

export const Header = () => {
  return (
    <header className="header-container">
      <h1 className="header-title">Profeco</h1>
      <div className="search-container">
        <input type="text" placeholder="Buscar..." className="search-input" />
      </div>
    </header>
  );
};
